test("JIVE-1430 Paste fancy list content from Word -> FF in Jive instance 1", function() {
    var rng = ed.dom.createRng();

	ed.setContent('<p>1234</p>');
	rng.setStart(ed.getBody().firstChild.firstChild, 0);
	rng.setEnd(ed.getBody().firstChild.firstChild, 4);
	ed.selection.setRng(rng);

    ed.selectionUtil.normalizeSelection();

	ed.execCommand('mceInsertClipboardContent', false, {content : '<style>@font-face { font-family: "Courier New"; }@font-face { font-family: "Wingdings"; }@font-face { font-family: "Calibri"; }p.MsoNormal, li.MsoNormal, div.MsoNormal { margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: "Times New Roman"; }div.Section1 { page: Section1; }ol { margin-bottom: 0in; }ul { margin-bottom: 0in; }</style> <p class="MsoNormal" style="margin-left: 0.5in; text-indent: -0.25in;"><span style="font-family: Wingdings;" lang="ES"><span style="">Ø<span style="font: 7pt &quot;Times New Roman&quot;;">&nbsp; </span></span></span><span style="" lang="ES">Asdf</span></p> <p class="MsoNormal" style="margin-left: 0.5in; text-indent: -0.25in;"><span style="font-family: Wingdings;" lang="ES"><span style="">Ø<span style="font: 7pt &quot;Times New Roman&quot;;">&nbsp; </span></span></span><span style="" lang="ES">Adsf</span></p> <br/>'});
    equal(ed.getContent().replace(/[\r\n]+/g, '').replace(/<p>[\s]*<\/p>/g, ''), '<ul style="list-style-type: disc;"><li>Asdf</li><li>Adsf</li></ul>');
});


