test("Paste into Chrome don't unformat table", function() {
    var rng = ed.dom.createRng();

	ed.setContent('<body>\n<table border="1" cellpadding="3" cellspacing="0" class="jiveBorder" style="width: 100%; border: 1px solid #000000;" jive-data-cell="{&quot;color&quot;:&quot;#000000&quot;,&quot;backgroundColor&quot;:&quot;&quot;,&quot;fontWeight&quot;:&quot;normal&quot;,&quot;textDecoration&quot;:&quot;none&quot;,&quot;fontStyle&quot;:&quot;normal&quot;,&quot;textAlign&quot;:&quot;left&quot;,&quot;padding&quot;:&quot;2&quot;}" jive-data-header="{&quot;color&quot;:&quot;#FFFFFF&quot;,&quot;backgroundColor&quot;:&quot;#6690BC&quot;,&quot;fontWeight&quot;:&quot;bold&quot;,&quot;textDecoration&quot;:&quot;none&quot;,&quot;fontStyle&quot;:&quot;normal&quot;,&quot;textAlign&quot;:&quot;center&quot;,&quot;padding&quot;:&quot;2&quot;}">\n<tbody>\n<tr>\n<th style="text-align: center; background-color: #6690bc; color: #ffffff; font-weight: bold;" valign="middle">Header 1</th><th style="text-align: center; background-color: #6690bc; color: #ffffff; font-weight: bold;" valign="middle">Header 2</th>\n</tr>\n<tr>\n<td><br /></td>\n<td><br /></td>\n</tr>\n<tr>\n<td><br /></td>\n<td><br /></td>\n</tr>\n</tbody>\n</table></body>');
	rng.setStart($j(ed.getBody()).find("td:first").get(0), 0);
	rng.setEnd($j(ed.getBody()).find("td:first").get(0), 1);
	ed.selection.setRng(rng);

    ed.selectionUtil.normalizeSelection();

	ed.execCommand('mceInsertClipboardContent', false, {content : 'asdf'});



    var content = $j("<div></div>").append(ed.getContent());

    ok($j(content).children(":nth(0)").is("table"), "first node is a table");
    equals($j(content).find("table td").length, 4, "4 tds");
    equals($j(content).find("table th").length, 2, "2 ths");
    equals($j(content).find("table td:first").text(), "asdf", "text is correct");
    ok(has(content, "table", "style", "border"), "border information was saved");
    ok(has(content, "table", "style", "width"), "width information was saved");
    ok(has(content, "table th", "style", "background-color"), "width information was saved");
    ok(has(content, "table th", "style", "text-align"), "text-align information was saved");
    ok(has(content, "table th", "style", "color"), "color information was saved");
    ok(has(content, "table th", "style", "font-weight"), "font-weight information was saved");

    //    equal(ed.getContent().replace(/[\r\n]+/g, ''), '<table border="1" cellpadding="3" cellspacing="0" class="jiveBorder" style="width: 100%; border: 1px solid #000000;"><tbody><tr><th style="text-align: center; background-color: #6690bc; color: #ffffff; font-weight: bold;" valign="middle">Header 1</th><th style="text-align: center; background-color: #6690bc; color: #ffffff; font-weight: bold;" valign="middle">Header 2</th> </tr><tr><td>asdf</td><td><br /></td></tr><tr><td><br /></td><td><br /></td></tr></tbody></table>');
});

