test("simple paste undo", function() {
    var rng = ed.dom.createRng();

    ed.setContent('<p>1234</p>');
    rng.setStart(ed.getBody().firstChild.firstChild, 0);
    rng.setEnd(ed.getBody().firstChild.firstChild, 4);
    ed.selection.setRng(rng);

    ed.selectionUtil.normalizeSelection();

	ed.execCommand('mceInsertClipboardContent', false, {content : 'test'});
    ed.undoManager.undo();

    equals(ed.getContent().replace(/[\r\n]+/g, ''), '<p>1234</p>');
});

test("complex paste undo", function() {
    var rng = ed.dom.createRng();

    ed.setContent('<p>1234</p>');
    rng.setStart(ed.getBody().firstChild.firstChild, 0);
    rng.setEnd(ed.getBody().firstChild.firstChild, 4);
    ed.selection.setRng(rng);

    ed.selectionUtil.normalizeSelection();

	ed.execCommand('mceInsertClipboardContent', false, {content : '<p>test</p><ul><li>bullet</li></ul>'});
    ed.undoManager.undo();

    equals(ed.getContent().replace(/[\r\n]+/g, ''), '<p>1234</p>');
});


