test("Strip -moz styles from border color", function(){
    var rng = ed.dom.createRng();

    ed.setContent('<p>1234</p>');
    rng.setStart(ed.getBody().firstChild.firstChild, 0);
    rng.setEnd(ed.getBody().firstChild.firstChild, 4);
    ed.selection.setRng(rng);

    ed.selectionUtil.normalizeSelection();

	ed.execCommand('mceInsertClipboardContent', false, {content : '<table style="border-color: white -moz-use-text-color;"><tbody><tr style="border-color: white -moz-use-text-color;"><td style="border-color: white -moz-use-text-color;">Cell</td></tr></tbody></table>'});
    ok(!/-moz/.test(ed.getContent), "-moz stripped");
});